pragma solidity ^0.8.15;

// WRITE A SOLIDITY PROGRAM FOR FUNCTION, VIEW FUNCTION, PURE FUNCTION & FALLBACK FUNCTION.
// Normal Function
contract SolidityTest {
    function getResult() public pure returns (string memory) {
        uint256 a = 10;
        uint256 b = 113;
        uint256 c = a + b;
        return integerToString(c);
    }

    function integerToString(uint256 i) private pure returns (string memory) {
        if (i == 0) return "0";
        uint256 j = i;
        int256 len = 0;
        while (j != 0) {
            j = j / 10;
            len = len + 1;
        }
        int256 k = len - 1;
        bytes memory bstr = new bytes(uint256(len));
        while (i != 0) {
            bstr[uint256(k--)] = bytes1(uint8(48 + (i % 10)));
            i /= 10;
        }
        return string(bstr);
    }
}

